import React from "react";
import SearchBar from "../SEARCHBAR/SearchBar";
import style from "./Nav.module.css"

const Nav = ({onSearch}) => {
 
    return (
      <div className={style.nav} >
        <h1>Welcome to the multiverse</h1>
        <SearchBar onSearch={onSearch}/>
      </div>
    );
}

export default Nav;
